void OAIProjectsApi::projects_updateColumn(const qint32 &column_id, const OAIProjects_update_column_request &oai_projects_update_column_request) {
    QString fullPath = QString(_serverConfigs["projects_updateColumn"][_serverIndices.value("projects_updateColumn")].URL()+"/projects/columns/{column_id}");
    
    
    {
        QString column_idPathParam("{");
        column_idPathParam.append("column_id").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "column_id", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"column_id"+pathSuffix : pathPrefix;
        fullPath.replace(column_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(column_id)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "PATCH");

    {

        
        QByteArray output = oai_projects_update_column_request.asJson().toUtf8();
        input.request_body.append(output);
    }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIProjectsApi::projects_updateColumnCallback);
    connect(this, &OAIProjectsApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

